import UserConfig from './pages/UserConfig';
import Login from './pages/Login';
import './App.css';

function App() {
    return (
        <Router>
            <AuthProvider>
                <PermissionsProvider>
                    <Routes>
                        <Route path="/login" element={<Login />} />
                        <Route path="/config" element={<UserConfig />} />
                        {/* Otras rutas de tu aplicaci√≥n */}
                    </Routes>
                </PermissionsProvider>
            </AuthProvider>
        </Router>
    );
}

export default App;
